private void attachNodeLeft(Node<E> node, Node<E> newNode) {
  newNode.parent = node;
  node.left = newNode;

  newNode.next = node;
  newNode.prev = node.prev;
  if (newNode.prev != null) {
    newNode.prev.next = newNode;
  }
  node.prev = newNode;
  balanceInsert(newNode);
}
